export default function StockCard() {
    // const classes = useStyles();
  return (
    <Card sx={{
      maxWidth: 300,
      margin: 5,
    }}>
      <CardContent >
        <div
          style={{
            display: 'flex',
            flexDirection: 'row',
          }}>
          <Typography variant="h5" component="div"
          style={{
            flex: 1,
            fontSize: '35px'
          }}>
            APOLO
          </Typography>
          <div>
            <Typography variant="h5" component="div"
            style={{
              flex: 1,
              textAlign: 'right',
              fontSize: '40px'
            }}>
              0.2
            </Typography>
            <Typography variant="body" component="div"
            style={{
              flex: 1,
              textAlign: 'right',
              fontSize: '10px'
            }}>
              Profit (INR)
            </Typography>
          </div>
          
        </div>
      </CardContent>
      <CardContent>
        <Typography variant="h5" component="div">
          Apollo Hospital
        </Typography>
        <div>
          <Typography variant="body2" color="text.secondary">
            BSE Current Price: 125.5
          </Typography>
          {/* <CardMedia
            component="img" // Use "img" for images, or "video" for videos
            height="140" // Set the desired height for the media content
            image={images.buy} // Replace this with the URL of your image or video
            alt="Image description" // Provide an accessible description for the media content
          /> */}
        </div>
        <div>
          <Typography variant="body2" color="text.secondary">
            NSE Current Price: 125.7
          </Typography>
        </div>
      </CardContent>
      <CardActions>
        <Button size="small">Save</Button>
        <Button size="small">Learn More</Button>
      </CardActions>
    </Card>
  );
}
